INSERT INTO `events` VALUES (357, 147, 'training', 'Egészségügyis Képzés  ', 'November 7. szombaton reggel 8 órától délután 5 ig, Szakonyfaluban lesz egy elméleti és gyakorlati képzés, amin részt kell venni minimum 5-7 fővel. A fiúk öltözéke: bevetési ruha, de csak az újak jók!!! Ebédet kaptok: Leves, Pöri+nokedli meg ubi. Én nem tudok menni, úgy hogy majd kell egy önként jelentkező aki összeszedi és felügyeli a csapatot. Létszám a kaja miatt kell nekem, jövő hét végéig. Azzal viszont számoljatok, hogy valószínű már nem lesz autónk, majd saját autóval kell menni.  Kaptok papírt is az elvégzett tanfolyamról.', 'Szakonyfalu kultúrház', 46.92463847477254, 16.22788003312033, '2020-10-09 00:00:00', '2020-10-16 00:00:00', '', '', '', '', '', NULL, NULL, '');
